import React from "react";
import style from "./info.module.css";

function Info(props) {
  const { findings } = summary;
  return (
    <div className="container">
      <div className="row">
        <h1 className={style["title1"]}>סיכום מנהלים</h1>

        <div className={style["text80"]} /**פה יגיע המידע מJSON  */>
          המערכת סרקה 38 מקורות מידע שונים בתחומים של מידע משפטי, כספים, אישי
          והקשרים בתחומי טרור ועוד.
        </div>
        <div className={style["memzaim65"]}>
          {props.findings && props.findings.length > 0 ? (
            <p>להלן הפירוט של הממצאים העיקריים:</p>
          ) : (
            <p>אין ממצאים להצגה</p>
          )}
        </div>
      </div>
    </div>
  );
}

export default Info;
